function TitleDetail({data ,onchenge}) {
    console.log(data);
    return (
        <div>
            <table border={1}>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>UserName</th>
                    </tr>
                </thead>
                <tbody>
                   {!data ? <h1>Loding...</h1>  :data.map((value)=>{
                    console.log(value);
                   })}
                </tbody>


            </table>
            <button>Left</button>
            <button onClick={onchenge}>Right</button>
        </div>
    )
}
export default TitleDetail
